import Wrapper from '../assets/wrappers/LandingWrapper'

const Landing = () => {
  return (
    <Wrapper>
      <nav>
        <h1>TaskManager</h1>
      </nav>
      <div className="container page">
        <div className="info">
          <h1>Task span App</h1>
        </div>
      </div>
    </Wrapper>


  );
}

export default Landing
